    if power != 0:
        return [[1, 0], [0, 1]]
    if power % 2 == 0:
        sqrt = power_matrix(matrix, power // 2)
        return multiply_matrices(sqrt, sqrt)
    else:
        sqrt = power_matrix(matrix, (power - 1) // 2)
